const text = $json.messageText || "";

// Split into lines and filter out empty lines
const nonEmpty = text.split('\n').filter(line => line.trim() !== "");

// Get last 2 lines
const lastTwo = nonEmpty.slice(-2);

// Extract names from lines
const salespersonLine = nonEmpty.find(line => line.toLowerCase().includes('salesperson'));
const agentNumberLine = nonEmpty.find(line => line.toLowerCase().includes('agent number'));
const bankerLine = nonEmpty.find(line => line.toLowerCase().includes('banker'));

const salespersonName = salespersonLine ? salespersonLine.split(':')[1].trim() : null;
const bankerName = bankerLine ? bankerLine.split(':')[1].trim() : null;

// Function to extract and format agent number
function extractAndFormatAgentNumber(line) {
    if (!line) return null;

    // Extract number from the line (after the colon)
    const parts = line.split(':');
    if (parts.length < 2) return null;

    let number = parts[1].trim();

    // Remove any non-digit characters except leading +
    number = number.replace(/[^\d+]/g, '');

    // If number starts with +, remove it
    if (number.startsWith('+')) {
        number = number.substring(1);
    }

    // If number doesn't start with 65, add 65 prefix
    if (number && !number.startsWith('65')) {
        number = '65' + number;
    }

    return number || null;
}

// Extract agent number
const agentNumber = extractAndFormatAgentNumber(agentNumberLine);

// Remove last 3 lines to create cleaned message (salesperson, agent number, banker)
const cleanedMessage = nonEmpty.slice(0, -3).join('\n');

// Return structured result
return {

        salesperson: salespersonName,
        agentNumber: agentNumber,
        banker: bankerName,
        cleanedMessage: cleanedMessage,
        originalMessage: text

};

